# @lc code=start
class Solution:
    def numIslands(self, grid: list[list[str]]) -> int:
        m, n = len(grid), len(grid[0])
        color = 2
        dirs = ((1,0),(0,1),(-1,0),(0,-1))
        q = deque()

        for i in range(m):
            for j in range(n):
                if grid[i][j] == "1": 
                    grid[i][j] = str(color)
                    q.append((i, j))

                    while q:
                        x, y = q.popleft()
                        for dx, dy in dirs:
                            nx, ny = x+dx, y+dy
                            if nx>=0 and ny>=0 and nx<m and ny<n and grid[nx][ny]=="1":
                                grid[nx][ny] = str(color)
                                q.append((nx, ny))
                    #print(q)
                    #print(grid)
            
                    color += 1

        return color - 2

        
# @lc code=end

